        /// <summary>
        ///     Convert to the unit representation <paramref name="unit" />.
        /// </summary>
        /// <returns>Value converted to the specified unit.</returns>
        public double As(ReactiveEnergyUnit unit)
        {
            if(Unit == unit)
                return Convert.ToDouble(Value);

            var converted = AsBaseNumericType(unit);
            return Convert.ToDouble(converted);
        }

        /// <summary>
        ///     Converts this ReactiveEnergy to another ReactiveEnergy with the unit representation <paramref name="unit" />.
        /// </summary>
        /// <returns>A ReactiveEnergy with the specified unit.</returns>
        public ReactiveEnergy ToUnit(ReactiveEnergyUnit unit)
        {
            var convertedValue = AsBaseNumericType(unit);
            return new ReactiveEnergy(convertedValue, unit);
        }

        /// <summary>
        ///     Converts the current value + unit to the base unit.
        ///     This is typically the first step in converting from one unit to another.
        /// </summary>
        /// <returns>The value in the base unit representation.</returns>
        private double AsBaseUnit()
        {
            switch(Unit)
            {
                case ReactiveEnergyUnit.CentivoltampereReactiveHour: return (_value) * 1e-2d;
                case ReactiveEnergyUnit.DecavoltampereReactiveHour: return (_value) * 1e1d;
                case ReactiveEnergyUnit.DecivoltampereReactiveHour: return (_value) * 1e-1d;
                case ReactiveEnergyUnit.ExavoltampereReactiveHour: return (_value) * 1e18d;
                case ReactiveEnergyUnit.FemtovoltampereReactiveHour: return (_value) * 1e-15d;
                case ReactiveEnergyUnit.GigavoltampereReactiveHour: return (_value) * 1e9d;
                case ReactiveEnergyUnit.HectovoltampereReactiveHour: return (_value) * 1e2d;
                case ReactiveEnergyUnit.KilovoltampereReactiveHour: return (_value) * 1e3d;
                case ReactiveEnergyUnit.MegavoltampereReactiveHour: return (_value) * 1e6d;
                case ReactiveEnergyUnit.MicrovoltampereReactiveHour: return (_value) * 1e-6d;
                case ReactiveEnergyUnit.MillivoltampereReactiveHour: return (_value) * 1e-3d;
                case ReactiveEnergyUnit.NanovoltampereReactiveHour: return (_value) * 1e-9d;
                case ReactiveEnergyUnit.PetavoltampereReactiveHour: return (_value) * 1e15d;
                case ReactiveEnergyUnit.PicovoltampereReactiveHour: return (_value) * 1e-12d;
                case ReactiveEnergyUnit.QutravoltampereReactiveHour: return (_value) * 1e27d;
                case ReactiveEnergyUnit.TeravoltampereReactiveHour: return (_value) * 1e12d;
                case ReactiveEnergyUnit.VettavoltampereReactiveHour: return (_value) * 1e30d;
                case ReactiveEnergyUnit.VoltampereReactiveHour: return _value;
                case ReactiveEnergyUnit.YottavoltampereReactiveHour: return (_value) * 1e24d;
                case ReactiveEnergyUnit.ZettavoltampereReactiveHour: return (_value) * 1e21d;
                default:
                    throw new NotImplementedException($"Can not convert {Unit} to base units.");
            }
        }

        private double AsBaseNumericType(ReactiveEnergyUnit unit)
        {
            if(Unit == unit)
                return _value;

            var baseUnitValue = AsBaseUnit();

            switch(unit)
            {
                case ReactiveEnergyUnit.CentivoltampereReactiveHour: return (baseUnitValue) / 1e-2d;
                case ReactiveEnergyUnit.DecavoltampereReactiveHour: return (baseUnitValue) / 1e1d;
                case ReactiveEnergyUnit.DecivoltampereReactiveHour: return (baseUnitValue) / 1e-1d;
                case ReactiveEnergyUnit.ExavoltampereReactiveHour: return (baseUnitValue) / 1e18d;
                case ReactiveEnergyUnit.FemtovoltampereReactiveHour: return (baseUnitValue) / 1e-15d;
                case ReactiveEnergyUnit.GigavoltampereReactiveHour: return (baseUnitValue) / 1e9d;
                case ReactiveEnergyUnit.HectovoltampereReactiveHour: return (baseUnitValue) / 1e2d;
                case ReactiveEnergyUnit.KilovoltampereReactiveHour: return (baseUnitValue) / 1e3d;
                case ReactiveEnergyUnit.MegavoltampereReactiveHour: return (baseUnitValue) / 1e6d;
                case ReactiveEnergyUnit.MicrovoltampereReactiveHour: return (baseUnitValue) / 1e-6d;
                case ReactiveEnergyUnit.MillivoltampereReactiveHour: return (baseUnitValue) / 1e-3d;
                case ReactiveEnergyUnit.NanovoltampereReactiveHour: return (baseUnitValue) / 1e-9d;
                case ReactiveEnergyUnit.PetavoltampereReactiveHour: return (baseUnitValue) / 1e15d;
                case ReactiveEnergyUnit.PicovoltampereReactiveHour: return (baseUnitValue) / 1e-12d;
                case ReactiveEnergyUnit.QutravoltampereReactiveHour: return (baseUnitValue) / 1e27d;
                case ReactiveEnergyUnit.TeravoltampereReactiveHour: return (baseUnitValue) / 1e12d;
                case ReactiveEnergyUnit.VettavoltampereReactiveHour: return (baseUnitValue) / 1e30d;
                case ReactiveEnergyUnit.VoltampereReactiveHour: return baseUnitValue;
                case ReactiveEnergyUnit.YottavoltampereReactiveHour: return (baseUnitValue) / 1e24d;
                case ReactiveEnergyUnit.ZettavoltampereReactiveHour: return (baseUnitValue) / 1e21d;
                default:
                    throw new NotImplementedException($"Can not convert {Unit} to {unit}.");
            }
        }

